import { getIdCardInfo, getIdCardImg, getIdCardAll } from './cardUtil';
import moment from 'moment';
import { message } from 'antd';
import { _uploadImg } from 'api';
import { base64ConvertFile, _get } from 'utils';

export async function readStuIdCardData() {
  const result = await getIdCardAll();

  if (_get(result, 'result') === false) {
    return {};
  }
  if (_get(result, 'return') !== '144') {
    message.error(_get(result, 'info', '读取失败'));
  }

  return { result };
}
export async function readIdCardData(form: any, name: string, callback?: any) {
  const result = await getIdCardAll();
  // const imgResult = await getIdCardImg();
  // console.log(result);
  // return result;
  let imgRes: any = {};
  if (_get(result, 'result') === false) {
    return {};
  }
  if (_get(result, 'return') === '144') {
    let birthday = `${_get(result, 'data.idNo').substring(6, 10)}-${_get(result, 'data.idNo').substring(10, 12)}-${_get(
      result,
      'data.idNo',
    ).substring(12, 14)}`;

    form.setFields([
      { name: name, value: _get(result, 'data.name') },
      { name: 'sex', value: _get(result, 'data.sex') === '女' ? '2' : '1' },
      { name: 'address', value: _get(result, 'data.address') },
      { name: 'cardtype', value: '1' },
      { name: 'idcard', value: _get(result, 'data.idNo') },
      { name: 'idcardVerify', value: _get(result, 'data.idNo') },
      { name: 'birthday', value: moment(birthday) },
    ]);
    if (_get(result, 'photo', '')) {
      const file = base64ConvertFile(_get(result, 'photo', ''));
      let formData = new FormData();
      formData.append('file', file);
      imgRes = await _uploadImg(formData);
    } else {
      message.error(_get(result, 'info', '未读取到二代证照片'));
    }
  } else {
    message.error(_get(result, 'info', '读取失败'));
  }
  if (callback) {
    callback(_get(result, 'data', {}), _get(imgRes, 'data', {}), _get(result, 'cardNo'));
  }
  return { cardInfoResult: result, imgData: _get(imgRes, 'data', {}), samId: _get(result, 'cardNo') };
}
//读取二代证与当前二代证号不一致，且用户确认要修改时处理
export async function handleStuIdCardDiff(props: {
  result: any;
  form: any;
  birthday: any;
  isImgDisable: any;
  setImageUrl: any;
  setImgId: any;
}) {
  const { result, form, birthday, isImgDisable, setImageUrl, setImgId } = props;
  form.setFields([
    { name: 'sex', value: _get(result, 'data.sex') === '女' ? '2' : '1' },
    { name: 'cardtype', value: '1' },
    { name: 'idcard', value: _get(result, 'data.idNo') },
    { name: 'idcardVerify', value: _get(result, 'data.idNo') },
    { name: 'birthday', value: moment(birthday) },
  ]);

  //照片允许修改
  if (!isImgDisable) {
    if (_get(result, 'photo', '')) {
      const file = base64ConvertFile(_get(result, 'photo', ''));
      let formData = new FormData();
      formData.append('file', file);
      const imgRes = await _uploadImg(formData);
      setImageUrl(_get(imgRes, 'data.url'));
      setImgId(_get(imgRes, 'data.id'));
    } else {
      message.error(_get(result, 'info', '未读取到二代证照片'));
    }
  }
}

//读取学员二代证（新增用）
export async function handleReadStuIdCardNormal(props: any) {
  const { form, result, birthday, setImageUrl, setImgId } = props;
  const _name = _get(result, 'data.name', ''); //读身份证读取的姓名
  const _idcard = _get(result, 'data.idNo', ''); //读二代证读取的姓名

  form.setFields([
    { name: 'name', value: _name },
    { name: 'sex', value: _get(result, 'data.sex') === '女' ? '2' : '1' },
    { name: 'address', value: _get(result, 'data.address') },
    { name: 'cardtype', value: '1' },
    { name: 'idcard', value: _idcard },
    { name: 'idcardVerify', value: _idcard },
    { name: 'birthday', value: moment(birthday) },
  ]);
  if (_get(result, 'photo', '')) {
    const file = base64ConvertFile(_get(result, 'photo', ''));
    let formData = new FormData();
    formData.append('file', file);
    const imgRes = await _uploadImg(formData);
    setImageUrl(_get(imgRes, 'data.url'));
    setImgId(_get(imgRes, 'data.id'));
  } else {
    message.error(_get(result, 'info', '未读取到二代证照片'));
  }
}

